import React from 'react';


export default function () {
    return <div>
        <div>
            <p>
                Simone Cleaning Services LLC. is a leading provider of Commercial and Residential Cleaning services. Our experience in successful partnerships with firms in the industry means that we understand the challenges you face in your business, and we deliver products and services to aid you in reaching all of your Specialty Cleaning needs.
                OURLEADER
                Our president has 10 years' experience in the Cleaning industry. She is dedicated to upholding our company values and delivering the greatest possible experience to our partners and clients.

            </p>
        </div>


    </div>;
}
